import { createSelector } from 'reselect';

const selectMainOrder = state => state.mainOrderReducer


export const selectMainOrderList = createSelector(
    [selectMainOrder],
    orderList => orderList.mainOrderList
)

export const selectSites = createSelector(
    [selectMainOrderList],
    mainOrderList => mainOrderList.data.map((order) => (order.site_name))
    //mainOrderList => mainOrderList.data.reduce((acc, order) => (!acc.contains(order.site_name) ? acc.push(order.site_name) : ''), [])
)
